import React from "react";
import "./hero.css";
import hand_icon from "../Assets/hand_icon.png";

const Hero = () => {
  return (
    <div className="hero">
      <div className="hero-left">
        <h2>NEEW ARIVALS ONLY</h2>
      </div>
      <div className="hero-right">
        <div>
          <div className="hand-hand-icon">
            <p>new</p>
            <img src={hand_icon} alt="" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Hero;
